import React from 'react';

const About = () => {
  return (
    <div className="container">
      <h4>About Us</h4>
      <p>
        Our society is dedicated to promoting community engagement and welfare. 
        We strive to create a welcoming environment for all members and work towards common goals that benefit the community.
      </p>
    </div>
  );
};

export default About;
